import{_ as t}from"./chunks/autotune.EOQH3DT_.js";import{_ as l,c as i,o,ab as a,m as e}from"./chunks/framework.CUflZczI.js";const A=JSON.parse('{"title":"Автоналаштування","description":"","frontmatter":{},"headers":[],"relativePath":"uk/config/autotune.md","filePath":"uk/config/autotune.md"}'),r={name:"uk/config/autotune.md"},n=a('<h1 id="автоналаштування" tabindex="-1">Автоналаштування <a class="header-anchor" href="#автоналаштування" aria-label="Permalink to &quot;Автоналаштування&quot;">​</a></h1><p>Автоналаштування автоматизує процес налаштування контролерів швидкості та ставлення PX4, які є найважливішими контролерами для стабільного та реактивного польоту (інші налаштування є більш &quot;необов&#39;язковими&quot;). Наразі це увімкнено для багатокоптерних, фіксованих крил та гібридних ВТОЛ фіксованих крилових літаків.</p><p>Настроювання потрібно робити лише один раз і рекомендується, якщо ви використовуєте транспортний засіб, який вже був налаштований виробником (і не змінювався з того часу).</p><div class="warning custom-block"><p class="custom-block-title">WARNING</p><p>Автоналаштування виконується під час польоту. Каркас повинен добре літати, щоб впоратися з помірними перешкодами, і повинен бути уважно контрольований:</p><ul><li>Перевірте, що ваш автомобіль достатньо <a href="#pre-tuning-test">стабільний для автоналаштування</a>.</li><li>Будьте готові перервати процес автоналагодження. Ви можете зробити це, змінивши режими польоту або використовуючи перемикач увімкнення / вимкнення автонаведення (<a href="#enable-disable-autotune-switch-fixed-wing">якщо налаштовано</a>).</li><li>Перевірте, що автомобіль добре літає після налаштування.</li></ul></div>',4),h=e("p",null,[e("div",{class:"embed-responsive embed-responsive-16by9"},[e("iframe",{class:"embed-responsive-item youtube-player",type:"text/html",width:"640",height:"390",src:"https://www.youtube.com/embed/5xswOhhqrIQ",frameborder:"0",webkitallowfullscreen:"",mozallowfullscreen:"",allowfullscreen:""})])],-1),c=a('<h2 id="попереднє-налаштування-тесту" tabindex="-1">Попереднє налаштування тесту <a class="header-anchor" href="#попереднє-налаштування-тесту" aria-label="Permalink to &quot;Попереднє налаштування тесту&quot;">​</a></h2><p>Транспортний засіб повинен бути здатний літати і належним чином стабілізувати себе перед запуском автоматичного налаштування. Цей тест дозволяє забезпечити безпечний польот транспортного засобу в режимах управління положенням.</p><div class="info custom-block"><p class="custom-block-title">Під час <a href="./../config/airframe.html">Налаштування рами</a> ви повинні були вибрати раму, яка найбільше відповідає вашому транспортному засобу. Можливо, це досить добре працюватиме для запуску автоналаштування.</p></div><p>Переконайтеся, що транспортний засіб достатньо стабільний для автоналаштування:</p><ol><li>Виконайте звичайний контрольний перелік безпеки перед польотом, щоб переконатися, що зона польоту чиста і має достатньо місця.</li><li>Зльот та підготовка до тесту <ul><li><strong>Багатокоптери:</strong> Злітайте та зависайте на висоті 1 м над землею в режимі <a href="./../flight_modes_mc/altitude.html">Режим висоти</a> або стабілізованому режимі.</li><li><strong>Фіксований крило:</strong> Злітайте та летіть з крейсерською швидкістю в режимі <a href="./../flight_modes_mc/position.html">Режим позиції</a> або <a href="./../flight_modes_mc/altitude.html">Режим висоти</a>.</li></ul></li><li>Використовуйте палицю кочення пульта керування RC для виконання наступного маневру, нахиливши транспортний засіб лише на кілька градусів: <em>нахил ліворуч &gt; нахил праворуч &gt; центр</em> (Весь маневр повинен зайняти близько 3 секунд). Транспортний засіб повинен стабілізуватися протягом 2 коливань.</li><li>Повторіть маневр, нахиляючись з більшими амплітудами при кожної спроби. Якщо транспортний засіб може стабілізуватися протягом 2 коливань під кутом близько 20 градусів, перейдіть до наступного кроку.</li><li>Повторіть ті ж маніпуляції, але по осі поля. Як вище, почніть з невеликих кутів і підтвердіть, що транспортний засіб може стабілізуватися самостійно протягом 2 коливань, перш ніж збільшувати нахил.</li></ol><p>Якщо безпілотник може стабілізувати себе протягом 2 коливань, він готовий до процедури автоматичного налаштування.</p><p>Якщо ні, перейдіть до розділу <a href="#troubleshooting">вирішення проблем</a>, де пояснюється мінімальна ручна настройка для підготовки автомобіля до автоматичної настройки.</p><h3 id="процедура-автоналагодження" tabindex="-1">Процедура автоналагодження <a class="header-anchor" href="#процедура-автоналагодження" aria-label="Permalink to &quot;Процедура автоналагодження&quot;">​</a></h3><p>Послідовність автоматичного налаштування повинна бути виконана в <strong>безпечній зоні польоту, з достатньою площею</strong>. Це займає близько 40 секунд (<a href="#how-long-does-autotuning-take">між 19 і 68 секундами</a>). Для найкращих результатів ми рекомендуємо проводити тестування в спокійні погодні умови.</p><p>Рекомендовані режими для автоналагодження - <a href="./../flight_modes_fw/hold.html">Режим утримання</a> (FW) та <a href="./../flight_modes_mc/altitude.html">Режим висоти</a> (MC), але можна використовувати будь-який інший режим польоту. Під час автоматичного налаштування RC палиці все ще можна використовувати для польоту транспортного засобу.</p><div class="info custom-block"><p class="custom-block-title">Послідовність автоматичного налаштування можна перервати у будь-який момент, змінивши режими польоту або використовуючи <a href="#enable-disable-autotune-switch-fixed-wing">ввімкнути / вимкнути перемикач автоматичного налаштування</a> (якщо налаштовано).</p></div><p>Кроки наступні:</p><ol><li>Виконайте <a href="#pre-tuning-test">тест передналаштування</a>.</li><li>Зліт за допомогою керування RC та підготовка до тесту: <ul><li><strong>Багатокоптери:</strong> Зліт за допомогою пульта дистанційного керування в <a href="./../flight_modes_mc/altitude.html">Режимі висоти</a>. Наведіть транспортний засіб на безпечній відстані та на кілька метрів над землею (між 4 та 20 м).</li><li><strong>Планер:</strong> Після польоту з крейсерською швидкістю активуйте <a href="./../flight_modes_mc/hold.html">Режим утримання</a>. Це допоможе літаку летіти по колу на постійній висоті та швидкості.</li></ul></li><li>Enable autotune.</li></ol><div class="tip custom-block"><p class="custom-block-title">TIP</p><p>Якщо налаштовано <a href="#enable-disable-autotune-switch-fixed-wing">перемикач увімкнення/вимкнення автоналаштування</a>, ви можете просто перемкнути перемикач у положення &quot;увімкнено&quot;.</p></div><ol><li><p>У QGroundControl відкрийте меню: <strong>Налаштування Транспортного Засобу &gt; Налаштування PID</strong></p><p><img src="'+t+'" alt="Tuning Setup &gt; Autotune Enabled"></p></li><li><p>Виберіть вкладки <em>Контролер швидкості</em> або <em>Контролер нахилу</em>.</p></li><li><p>Переконайтеся, що кнопка увімкнення <strong>Автопідгонки</strong> увімкнена (це відобразить кнопку <strong>Автопідгонки</strong> та видалить селектори ручного налаштування).</p></li><li><p>Прочитайте спливаюче вікно попередження та натисніть на <strong>OK</strong>, щоб почати налаштування.</p></li><li><p>Дрон спочатку почне виконувати швидкі рухи кочення, а потім рухи тангажу та рухи курсу. Прогрес відображається на панелі прогресу, поруч з кнопкою <em>Автоналадка</em>.</p></li><li><p>Застосувати налаштування:</p><ul><li><strong>Фіксований крило:</strong> Налаштування буде негайно/автоматично застосовано й перевірено в польоті (за замовчуванням). PX4 потім проведе 4-секундний тест і поверне нове налаштування, якщо буде виявлено проблему.</li><li><strong>Багатороторники:</strong> Вручну приземліться та роззбройтеся, щоб застосувати нові параметри налаштування. Піднімайтеся обережно і вручну перевіряйте, що транспортний засіб стійкий.</li></ul></li><li><p>Якщо виникають сильні коливання, негайно приземліться й дотримуйтеся інструкцій у розділі <a href="#troubleshooting">Усунення неполадок</a> нижче.</p></li></ol><p>Додаткові примітки:</p><ul><li><strong>VTOL:</strong> Гібридні ВТОЛ фіксовані крила повинні бути налаштовані двічі, слідуючи інструкціям для багтороторників у режимі MC та інструкціям для фіксованих крил у режимі FW.</li><li><strong>Багатокоптер:</strong> Інструкції вище налаштовують транспортний засіб у <a href="./../flight_modes_mc/altitude.html">Режим висоти</a>. Замість цього ви можете здійснити зльот у режимі <a href="./../flight_modes_mc/takeoff.html">Зльоту</a> та налаштувати режим <a href="./../flight_modes_mc/position.html">Позиції</a>, якщо <em>відомо</em>, що транспортний засіб стабільний в цих режимах.</li><li><strong>Фіксований крило:</strong> Автоналагодження також може бути запущено в режимі <a href="./../flight_modes_fw/altitude.html">Режим висоти</a> або <a href="./../flight_modes_fw/position.html">Режим позиції</a>. Проте виконання тесту під час прямого польоту потребує більшої безпечної зони для налаштування і не дає значно кращого результату налаштування.</li><li>Чи налаштування застосовується у повітрі чи після посадки можна <a href="#apply-parameters-when-in-air-landed">налаштувати за допомогою параметрів</a>.</li></ul><h2 id="вирішення-проблем" tabindex="-1">Вирішення проблем <a class="header-anchor" href="#вирішення-проблем" aria-label="Permalink to &quot;Вирішення проблем&quot;">​</a></h2><h4 id="дрон-коливається-при-виконанні-випробувальних-маневрів-перед-автоматичним-налаштуванням" tabindex="-1">Дрон коливається при виконанні випробувальних маневрів перед автоматичним налаштуванням <a class="header-anchor" href="#дрон-коливається-при-виконанні-випробувальних-маневрів-перед-автоматичним-налаштуванням" aria-label="Permalink to &quot;Дрон коливається при виконанні випробувальних маневрів перед автоматичним налаштуванням&quot;">​</a></h4><ul><li>повільні осциляції (1 осциляція на секунду або повільніше): це часто відбувається на великих платформах і означає, що петля утримання позиції рухається занадто швидко порівняно з петлею швидкості. <ul><li><strong>Мультикоптер:</strong> зменшити <a href="./../advanced_config/parameter_reference.html#MC_ROLL_P">MC_ROLL_P</a> та <a href="./../advanced_config/parameter_reference.html#MC_PITCH_P">MC_PITCH_P</a> на 1,0 одиницю.</li><li><strong>Фіксований крило:</strong> збільшити <a href="./../advanced_config/parameter_reference.html#FW_R_TC">FW_R_TC</a> та <a href="./../advanced_config/parameter_reference.html#FW_P_TC">FW_P_TC</a> на кроки по 0.1.</li></ul></li><li>швидкі коливання (більше 1 коливання на секунду): це тому, що підсилення петлі швидкості занадто високе. <ul><li><strong>Мультикоптер:</strong> зменшити <code>MC_[ROLL|PITCH|YAW]RATE_K</code> на 0,02 одиниці</li><li><strong>Фіксований крило:</strong> зменшити <a href="./../advanced_config/parameter_reference.html#FW_RR_P">FW_RR_P</a>, <a href="./../advanced_config/parameter_reference.html#FW_PR_P">FW_PR_P</a>, <a href="./../advanced_config/parameter_reference.html#FW_YR_P">FW_YR_P</a> на кроки по 0.01.</li></ul></li></ul><h4 id="послідовність-автоматичноі-настроики-не-вдається" tabindex="-1">Послідовність автоматичної настройки не вдається <a class="header-anchor" href="#послідовність-автоматичноі-настроики-не-вдається" aria-label="Permalink to &quot;Послідовність автоматичної настройки не вдається&quot;">​</a></h4><p>Якщо безпілотник не рухався достатньо під час автоматичного налаштування, алгоритм ідентифікації системи може мати проблеми з визначенням правильних коефіцієнтів. Збільште <a href="./../advanced_config/parameter_reference.html#FW_AT_SYSID_AMP">FW_AT_SYSID_AMP</a>, <a href="./../advanced_config/parameter_reference.html#MC_AT_SYSID_AMP">MC_AT_SYSID_AMP</a> на одиницю і знову викличте автоматичне налаштування.</p><h4 id="дрон-коливається-після-автоналагодження" tabindex="-1">Дрон коливається після автоналагодження <a class="header-anchor" href="#дрон-коливається-після-автоналагодження" aria-label="Permalink to &quot;Дрон коливається після автоналагодження&quot;">​</a></h4><p>Через вплив ефектів, які не враховані в математичній моделі, такі як затримки, насичення, швидкість наростання, гнучкість конструкції, коефіцієнт підсилення петлі може бути занадто великим. Щоб виправити це, слідувати тим самим крокам, описаним <a href="#the-drone-oscillates-when-performing-the-testing-maneuvers-prior-to-the-auto-tuning">коли дрон коливається в попередньому тесті перед налаштуванням автоматичного налаштування</a>.</p><h4 id="я-все-ще-не-можу-зрозуміти-як-це-працює" tabindex="-1">Я все ще не можу зрозуміти, як це працює <a class="header-anchor" href="#я-все-ще-не-можу-зрозуміти-як-це-працює" aria-label="Permalink to &quot;Я все ще не можу зрозуміти, як це працює&quot;">​</a></h4><p>Спробуйте налаштувати вручну, використовуючи відповідні посібники:</p><ul><li><a href="./../config_mc/pid_tuning_guide_multicopter_basic.html">Посібник з налаштування PID для багатокоптерів</a> (Керівництво/Простий)</li><li><a href="./../config_mc/pid_tuning_guide_multicopter.html">Посібник з налаштування PID для багатокоптерів</a> (Advanced/Detailed)</li><li><a href="./../config_fw/pid_tuning_guide_fixedwing.html">Посібник з налаштування ПІД-регулятора з нерухомим крилом</a></li></ul><h2 id="необов-язкова-конфігурація" tabindex="-1">Необов&#39;язкова Конфігурація <a class="header-anchor" href="#необов-язкова-конфігурація" aria-label="Permalink to &quot;Необов&#39;язкова Конфігурація&quot;">​</a></h2><h3 id="застосовувати-параметри-у-повітрі-приземленні" tabindex="-1">Застосовувати параметри у повітрі/приземленні <a class="header-anchor" href="#застосовувати-параметри-у-повітрі-приземленні" aria-label="Permalink to &quot;Застосовувати параметри у повітрі/приземленні&quot;">​</a></h3><p>За замовчуванням транспортні засоби MC приземляються до застосування параметрів, тоді як транспортні засоби FW застосовують параметри у повітрі, а потім перевіряють, що контролери працюють належним чином. Цю поведінку можна налаштувати за допомогою параметрів <a href="./../advanced_config/parameter_reference.html#MC_AT_APPLY">MC_AT_APPLY</a> та <a href="./../advanced_config/parameter_reference.html#FW_AT_APPLY">FW_AT_APPLY</a> відповідно:</p><ul><li><code>0</code>: надбавки не застосовуються. Це використовується для тестування, якщо користувач хоче перевірити результати автоналаштування алгоритму без прямого їх використання.</li><li><code>1</code>: застосувати здобутки після роззброєння (типово для мультироторів). Оператор може перевірити нове налаштування під час обережного зльоту.</li><li><code>2</code>: застосувати негайно (за замовчуванням для фіксованих відгуків). Нове налаштування застосовується, перешкоди надсилаються контролеру, а стабільність контролюється протягом наступних 4 секунд. Якщо керуюче коло нестійке, керуючі коефіцієнти негайно повертаються до свого попереднього значення. Якщо тест пройшов успішно, пілот може використовувати нове налаштування.</li></ul><h3 id="увімкнути-вимкнути-перемикач-автотюнінгу-фіксовании-крило" tabindex="-1">Увімкнути/вимкнути перемикач автотюнінгу (фіксований крило) <a class="header-anchor" href="#увімкнути-вимкнути-перемикач-автотюнінгу-фіксовании-крило" aria-label="Permalink to &quot;Увімкнути/вимкнути перемикач автотюнінгу (фіксований крило)&quot;">​</a></h3><p>Пульт дистанційного керування може бути налаштований для увімкнення / вимкнення автодоналаштування (у будь-якому режимі) за допомогою додаткового каналу RC.</p><p>Для відображення перемикача:</p><ol><li>Виберіть канал RC на вашому контролері для використання перемикача увімкнення / вимкнення автоналадки.</li><li>Встановіть <a href="./../advanced_config/parameter_reference.html#RC_MAP_AUX1">RC_MAP_AUX1</a> для відповідності каналу RC вашому перемикачу (ви можете використовувати будь-який з <code>RC_MAP_AUX1</code> по <code>RC_MAP_AUX6</code>).</li><li>Встановіть <a href="./../advanced_config/parameter_reference.html#FW_AT_MAN_AUX">FW_AT_MAN_AUX</a> на вибраний канал (тобто <code>1: Aux 1</code>, якщо ви відобразили <code>RC_MAP_AUX1</code>).</li></ol><p>Автоналаштування буде вимкнено, коли перемикач знаходиться нижче <code>0.5</code> (в діапазоні ручного керування від <code>[-1, 1]</code> та увімкнено, коли канал перемикача знаходиться вище <code>0.5</code>.</p><p>Якщо використовується перемикач RC AUX для увімкнення автоналагодження, переконайтеся, що ви <a href="#select-tuning-axis-fixed-wing">вибрали вісі налаштування</a> перед польотом.</p><h3 id="виберіть-ось-тюнінгу-фіксовании-крило" tabindex="-1">Виберіть Ось Тюнінгу (Фіксований Крило) <a class="header-anchor" href="#виберіть-ось-тюнінгу-фіксовании-крило" aria-label="Permalink to &quot;Виберіть Ось Тюнінгу (Фіксований Крило)&quot;">​</a></h3><p>Літальні апарати з фіксованим крилом (тільки) можуть вибирати, які вісі налаштовуються за допомогою параметра бітової маски <a href="./../advanced_config/parameter_reference.html#FW_AT_AXES">FW_AT_AXES</a>:</p><ul><li>біт <code>0</code>: кидок (за замовчуванням)</li><li>біт <code>1</code>: кидок (за замовчуванням)</li><li>біт <code>2</code>: крен</li></ul><h2 id="розробники-sdks" tabindex="-1">Розробники/SDKs <a class="header-anchor" href="#розробники-sdks" aria-label="Permalink to &quot;Розробники/SDKs&quot;">​</a></h2><p>Автоналаштування починається за допомогою команди MAVLink <a href="https://mavlink.io/en/messages/common.html#MAV_CMD_DO_AUTOTUNE_ENABLE" target="_blank" rel="noreferrer">MAV_CMD_DO_AUTOTUNE_ENABLE</a>.</p><p>На момент написання повідомлення його пересилаються на регулярні інтервали для опитування PX4 на предмет прогресу: <code>COMMAND_ACK</code> включає результат, що операція в процесі виконання, а також прогрес у відсотках. Операція завершується, коли прогрес досягає 100% або транспортний засіб приземляється і роззброюється.</p><div class="info custom-block"><p class="custom-block-title">Це не є виконанням протоколу довгострокової команди <a href="https://mavlink.io/en/services/command.html#long_running_commands" target="_blank" rel="noreferrer">командного протоколу довгострокової команди</a> у відповідності до MAVLink. PX4 повинен транслювати прогрес, оскільки протокол не дозволяє опитування.</p></div><p>Функція ще не підтримується MAVSDK.</p><h2 id="background-detail" tabindex="-1">Background/Detail <a class="header-anchor" href="#background-detail" aria-label="Permalink to &quot;Background/Detail&quot;">​</a></h2><p>PX4 використовує <a href="./../flight_stack/controller_diagrams.html">PID контролери</a> (швидкість, ставлення, швидкість та положення), щоб розрахувати вихідні дані, необхідні для переміщення транспортного засобу з його поточного оціненого стану, щоб відповідати бажаному заданому значенню. Контролери повинні бути добре налаштовані, щоб отримати найкращу продуктивність з автомобіля. Зокрема, погано налаштований регулятор швидкості призводить до менш стабільного польоту у всіх режимах і потребує більше часу на відновлення після перешкод.</p><p>Загалом, якщо ви використовуєте <a href="./../config/airframe.html">конфігурацію рами</a>, яка схожа на ваш транспортний засіб, то транспортний засіб зможе літати. Однак, якщо конфігурація точно не відповідає вашому обладнанню, вам слід налаштувати регулятори швидкості та кута нахилу. Налаштування контролерів швидкості та позиції менш важливе, оскільки вони менше піддаються динаміці транспортного засобу, і типова конфігурація налаштування для схожого аеродинамічного корпусу часто є достатньою.</p><p>Автоналаштування забезпечує автоматичний механізм для налаштування регуляторів швидкості та кута нахилу. Це можна використовувати для налаштування літаків з фіксованим крилом та мультикоптерних транспортних засобів, а також літаків VTOL, коли літають як мультикоптерний транспортний засіб або з фіксованим крилом (перехід між режимами повинен бути налаштований вручну). Теоретично це повинно працювати для інших типів транспортних засобів, які мають регулятор швидкості, але наразі підтримуються лише вищезазначені типи.</p><p>Автоматична настройка працює добре для конфігурацій багатокоптерів та фіксованих крил, які підтримує PX4, за умови, що рама не занадто гнучка (див. <a href="#does-autotuning-work-for-all-supported-airframes">нижче для отримання додаткової інформації</a>).</p><p>Транспортний засіб повинен перебувати в режимі стабілізації висоти (такому як <a href="./../flight_modes_mc/altitude.html">Режим висоти</a>, <a href="./../flight_modes_mc/hold.html">Режим утримання</a> або <a href="./../flight_modes_mc/position.html">Режим позиції</a>). Стек польоту застосує невелике збурення до транспортного засобу в кожній з осей, а потім спробує розрахувати нові налаштувальні параметри. Для літаків нове налаштування застосовується в повітрі за замовчуванням, після чого транспортний засіб перевіряє нові налаштування і повертає налаштування, якщо контролери нестабільні. Для мультикоптера транспортний засіб приземляється і застосовує нові параметри налаштування після відбронювання; пілот повинен обережно злетіти і протестувати налаштування.</p><p>Процес налаштування займає близько 40 секунд (<a href="#how-long-does-autotuning-take">між 19 і 68 секундами</a>). Стандартна поведінка може бути налаштована за допомогою <a href="#optional-configuration">параметрів</a>.</p><h3 id="faq" tabindex="-1">FAQ <a class="header-anchor" href="#faq" aria-label="Permalink to &quot;FAQ&quot;">​</a></h3><h4 id="які-типи-кадрів-підтримуються" tabindex="-1">Які типи кадрів підтримуються? <a class="header-anchor" href="#які-типи-кадрів-підтримуються" aria-label="Permalink to &quot;Які типи кадрів підтримуються?&quot;">​</a></h4><p>Автоналаштування увімкнено для мультикоптерів, фіксованих крил та гібридних VTOL фіксованих крилових літаків.</p><p>Хоча це ще не активовано для інших типів кадрів, в теорії його можна використовувати з будь-яким кадром, який використовує контролер швидкості.</p><h4 id="чи-працює-автоналадка-для-всіх-підтримуваних-конструкціи" tabindex="-1">Чи працює автоналадка для всіх підтримуваних конструкцій? <a class="header-anchor" href="#чи-працює-автоналадка-для-всіх-підтримуваних-конструкціи" aria-label="Permalink to &quot;Чи працює автоналадка для всіх підтримуваних конструкцій?&quot;">​</a></h4><p>Математична модель, яку використовує автоналаштування для оцінки динаміки дрона, передбачає, що це лінійна система без зв&#39;язку між осями (SISO) та з обмеженою складністю (2 полюси та 2 нулі). Якщо справжній безпілотник занадто далеко від цих умов, модель не зможе відтворити реальну динаміку безпілотника.</p><p>На практиці, автоналаштування, як правило, добре працює для планерів та мультикоптерів, за умови, що рама не занадто гнучка.</p><h4 id="як-довго-триває-автоналагодження" tabindex="-1">Як довго триває автоналагодження? <a class="header-anchor" href="#як-довго-триває-автоналагодження" aria-label="Permalink to &quot;Як довго триває автоналагодження?&quot;">​</a></h4><p>Налаштування займає 5-20 секунд на вісь (припиняється, якщо налаштування не вдалося встановити за 20 секунд) + пауза 2 секунди між кожною віссю + 4 секунди тестування, якщо нові коефіцієнти застосовано у повітрі.</p><p>Мультикоптер повинен налаштовувати всі три осі, і за замовчуванням не перевіряє нові виграші у повітрі. Налаштування, отже, займе від 19 с (<code>5 + 2 + 5 + 2 + 5</code>) до 64 с (<code>20x3 + 2x2</code>).</p><p>За замовчуванням літак налагоджує всі три осі, а потім перевіряє нові коефіцієнти в повітрі. Діапазон становить від 25 с (<code>5 + 2 + 5 + 2 + 5 + 2 + 4</code>) до 70 с (<code>20x3 + 3x2 + 4</code>).</p><p>Зверніть увагу, що вищезазначені налаштування є значеннями за замовчуванням. Мультикоптер може вибрати проведення тестів в повітрі, а планер може вибрати не робити цього. Додатково, літак з фіксованим крилом може вибрати налаштувати менше вісей.</p><p>За анекдотичними даними, зазвичай це займає близько 40 секунд для будь-якого засобу пересування.</p><h2 id="дивись-також" tabindex="-1">Дивись також <a class="header-anchor" href="#дивись-також" aria-label="Permalink to &quot;Дивись також&quot;">​</a></h2><ul><li><a href="./../config_mc/pid_tuning_guide_multicopter_basic.html">Посібник з налаштування PID для багатокоптерів</a> (Керівництво/Простий)</li><li><a href="./../config_mc/pid_tuning_guide_multicopter.html">Посібник з налаштування PID для багатокоптерів</a> (Advanced/Detailed)</li><li><a href="./../config_fw/pid_tuning_guide_fixedwing.html">Посібник з налаштування ПІД-регулятора з нерухомим крилом</a></li></ul>',67),d=[n,h,c];function _(s,f,m,p,u,g){return o(),i("div",null,d)}const k=l(r,[["render",_]]);export{A as __pageData,k as default};
